import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';


const routes: Routes = [
  {
    path: '',
    redirectTo: 'subscription',
    pathMatch: 'full',
  },
  {path: 'pay/id', loadChildren: () => import('../Pages/p').then(m => m.SubscriptionsModule) }
  { path: 'subscription', loadChildren: () => import('../Pages/subscriptions/subscriptions.module').then(m => m.SubscriptionsModule) },

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
